import React from 'react';
import { Box } from '@mui/material';

function AuthLayout({ children }) {
  return (
    <Box
      sx={{
        minHeight: '100vh',
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
        backgroundColor: '#f9fafb',
        p: 2,
      }}
    >
      {children}
    </Box>
  );
}

export default AuthLayout;
